const AccountLong = ({ data, color }) => {
    return (
        <div className="my-profile d-flex align-items-center">
            <div className="d-flex flex-stack">
                <div className="symbol symbol-30px">
                    <div className={`symbol-label fs-2 fw-bold bg-${color} textinverse-${color}`}>
                        {data.fullname ? data.fullname.charAt(0) : "-"}
                    </div>
                </div>
            </div>
            <div className="text-dark fw-bolder fs-7 ms-2 text-right">
                <span className="d-block">{data.fullname}</span>
                <span className="text-muted">{data.id ? data.id :
                    data.id}</span>
            </div>
        </div>
    );
};
export { AccountLong };
